// Contenido del popup para cada feature
function popupContentNBI(feature) {
    return (
        "<div id='Estilo1'><h3>Descripción</h3></div>" +
        "<hr class='hrx' style='color: #ef7d26;' align='left' noshade='noshade' size='1' width='100%' />" +
        "<div id='Estilo3a'>" +
         "<b> Departamento: </b>" + feature.properties.DPTO_1 + "<br>" +
"<b> % de Hogares con NBI: </b>" + feature.properties.PorceNBI + "<br>" +
// "<b> Total Pob. Provicial con NAF : </b>" + feature.properties.suma_NAF + "<br>" +
"<b> Fuente : </b> Elaborado a partir de CENSO 2010" + "<br>" +
"<b> Fecha :  2010 </b>" + "<br>"+
        "</div>"
    );
}
function getColorNBI(PorceNBI) {
   
        {
            if (PorceNBI >= 0 && PorceNBI <= 15) return "#feebe2";
            if (PorceNBI > 15.1 && PorceNBI <= 20) return "#fbb4b9";
            if (PorceNBI > 21.1 && PorceNBI <= 30) return "#f768a1";
            if (PorceNBI > 30.1 && PorceNBI <= 40.9) return "#c51b8a";
            if (PorceNBI > 41.0 && PorceNBI <= 68.2) return "#b61686";
            if (PorceNBI > 68.9) return "#7a0177";
                   }
};

function styleNBI(feature) {
    return {
        fillColor: getColorNBI(feature.properties.PorceNBI),
        weight: 1,
        opacity: 0.9,
        color: '#292828',
        dashArray: '0',
        fillOpacity: 0.9,
        stroke: '#232323',
    }
}

// Función para generar la leyenda
function createLegendNBI() {
    var legend = L.control({ position: 'bottomright' });

    legend.onAdd = function () {
        var div = L.DomUtil.create('div', 'info legend');
        var labels = [];

        var styles = [
            { label: '% Hogares con NBI', color: '' },
            { label: '0 - 15', color: '#feebe2' },
            { label: '15.1 - 20', color: '#fbb4b9' },
            { label: '20.1 - 30', color: '#f768a1' },
            { label: '30.1 - 40', color: '#c51b8a' },
            { label: '40.9 - 60', color: '#b61686' },
            { label: '> 61', color: '#7a0177' },

            // Agrega aquí el resto de estilos con su respectiva etiqueta y color
        ];

        // Genera el contenido HTML de la leyenda
        styles.forEach(function (style) {
            labels.push(
                '<i style="background:' + style.color + '"></i> ' + style.label
            );
        });

        div.innerHTML = labels.join('<br>');
        return div;
    };

    // Función para mostrar/ocultar la leyenda
    function toggleLegend() {
        if (map.hasLayer(NBI)) {
            legend.addTo(map);
        } else {
            legend.remove();
        }
    }
// Eliminar la leyenda al inicio
legend.remove();
    // Escucha el cambio de estado de la capa
    map.on('overlayadd overlayremove', toggleLegend);
}